# Tax classes

The tax classes API allows you to create, view, and delete individual tax
classes.

## Tax class properties

Attribute | Type | Description  
---|---|---  
`slug` | string | Unique identifier for the resource. _read-only_  
`name` | string | Tax class name. _required_  

## Create a tax class

This API helps you to create a new tax class.

### HTTP request

_POST_

###### /wp-json/wc/v3/taxes/classes



    curl -X POST https://example.com/wp-json/wc/v3/taxes/classes \
        -u consumer_key:consumer_secret \
        -H "Content-Type: application/json" \
        -d '{
      "name": "Zero Rate"
    }'



    const data = {
      name: "Zero Rate"
    };

    WooCommerce.post("taxes/classes", data)
      .then((response) => {
        console.log(response.data);
      })
      .catch((error) => {
        console.log(error.response.data);
      });



    <?php
    $data = [
        'name' => 'Zero Rate'
    ];

    print_r($woocommerce->post('taxes/classes', $data));

$data));
    ?>



    data = {
        "name": "Zero Rate"
    }

    print(wcapi.post("taxes/classes", data).json())



    data = {
      name: "Zero Rate"
    }

    woocommerce.post("taxes/classes", data).parsed_response


